window.bookSummaryJSON = "<p><b>Nestled in the shadows of the Mori Forest lies The Ivy Institute. It may look like something out of a fairytale, but if the rumors are true, it’s where nightmares reign.</b></p> <p>The only way to get into the elite facility is by invitation and, once received, it’s impossible to refuse.</p> <p>They were never supposed to know I existed, yet here I am, walking toward the only place that might be more dangerous to me than where I grew up.</p> <p>Secrets shroud the institute and its inhabitants, but I have secrets too. Secrets that will get me killed…or worse.</p> <p>I guess I’m about to find out.</p> <p><b><i>Please note: Tender Thorns is a dark academia whychoose romance novel intended for mature audiences.</i></b></p>"; 
